Here at Seikolab we relish the opportunity to work with clients to achieve a unique build. This top down high end build for none other than Matt Farah of the @thesmokingtire was a no expense spared build with the key design choice being a special Tahitian black mother of pearl dial exhibiting a array of colours, facets , and textures. Couple that with a Ultraclear series blue AR tinted sapphire, ceramic YM bezel insert and a shark second hand for some pop. All wrapped in a fitted rubber strap on a double deployment butterfly clasp for something sporty with serious wrist presence! 

